import React from 'react';
import './style.css'
const Navbar = () => {
    return (
        <div className='nv-container'>
            <div className="nv-wrapper">
                <div className="nv-left">
                    <div className="nv-lang">En</div>
                    <div className="nv-search"></div>
                </div>
                <div className="nv-center"></div>
                <div className="nv-right"></div>
            </div>
        </div>
    );
}

export default Navbar;
